import React from 'react'

const ArrayMethod = () => {

const fruits = [
    {
        id: 1, name: 'apple', calories: 40,
        id: 2, name: 'mango', calories: 50,
        id: 3, name: 'orange', calories: 60,
        id: 4, name: 'pineapple', calories: 70
    }
]
console.log(fruits)
  return (
    <>
 <p>{fruits}</p>
    </>
    
  )
}

export default ArrayMethod
